import Crumbs from "../Crumbs/Crumbs";
import Header from "../Header/Header";
import Catalog from "../Catalog/Catalog";
import MobileNavBar from "../MobileNavBar/MobileNavBar";
import Tags from "../Tags/Tags";


export default function CatalogPage({ onCardClick, onLikeClick, products, savedProducts, isLoggedIn, terms, onCatClick, category, tags, onTagClick, onBurgerClick, onBurgerClose, isBurgerOpen, search, setSearch, orders, cart }) {

  // const location = useLocation();
  // const queryParams = new URLSearchParams(location.search);

  // access query parameters
  // const paramValue = queryParams.get("paramName");

  return (
    <>
    {/* <Crumbs/> */}
    <Tags 
      tags={terms.tags} 
      categories={terms.categories} 
      onTagClick={onTagClick}
      activeCategory={category}
      activeTags={tags}
    />
    <Catalog
      onCardClick={onCardClick}
      onLikeClick={onLikeClick}
      products={products}
      savedProducts={savedProducts}
      isLoggedIn={isLoggedIn}
    />
    <MobileNavBar 
    onBurger={onBurgerClick} 
    isBurgerOpen={isBurgerOpen} 
    onBurgerClose={onBurgerClose}
    cart={cart}
    orders={orders}/>
    </>
  )
}
